INSERT INTO `second_hand` VALUES ('test0101','1번째 게시글','1초가 아까워~','null.png','2023-05-02 16:14:36',1),('test0101','2번 게시글','네가 5번째니 6번째니? 두번째! 입니다!','null.png','2023-05-02 16:14:59',2),('test0101','3번 게시글','3은 가장 안정적인 수. 다리가 2개인 물체는 서있기 힘들고, 다리가 4개면 하나라도 길이가 다르면 흔들리지만 다리가 3개면 항상 위치가 고정된다','null.png','2023-05-02 16:16:10',3),('test0101','4번째 게시글','한국인이 가장 꺼려하는 숫자 4!','null.png','2023-05-02 16:16:57',4),('test0101','5번 게시글','5늘도 알차게 작업했...나?','null.png','2023-05-02 16:23:10',5),('test0101','6번째 게시글','666 악마의 숫자... ㄷㄷ','null.png','2023-05-02 16:23:31',6),('test0101','Lucky 7!','옛날 옛날 뇌전수리검이 1티어 표창이던 시절... 오르비스 구경가던 시절','null.png','2023-05-02 16:24:17',7),('test0101','8번째 게시글','8은 중국에서 가장 좋아하는 숫자라고 합니다. 돈을 벌다랑 발음이 비슷하다나 뭐라나','null.png','2023-05-02 16:25:16',8),('test0101','9번째 게시글','내맘대로 Z9별... 짧지만 재밌게 했었는데','null.png','2023-05-02 16:25:48',9),('test0101','10의 의미','토막상식.\n10은 우주를 타나태는 수, 창조의 패러다임이자, 모든 수를 포함하며 법, 질서, 지배 또는 모든 사물과 가능성을 의미한다고 합니다.','null.png','2023-05-02 16:26:50',10),('test0101','11번째','11번째 이제 테스트 끝!','null.png','2023-05-02 16:27:10',11),('test0101','12번째 테스트','이번에는 잘 되기를 기원하며... I wish...','null.png','2023-05-03 09:53:55',12),('asdasd123','누가 나 불렀냐','누구냐','asdasd123-2023-5-3-17-47-0.jpg','2023-05-03 17:47:00',13),('bigbowl123','','ㅋㅋㅋ','bigbowl123-2023-5-3-18-8-59.jpg','2023-05-03 18:08:59',14),('asdasd1234','','내가 접수~','asdasd1234-2023-5-4-11-0-12.jpg','2023-05-04 11:00:14',15),('doglover1','강아지 옷 팝니다 7000원','안녕하세요 강아지 옷 팝니다\n저희 강아지는 옷을 별로 안좋아하네요\n상태 좋습니다.\n댕톡주세요','doglover1-2023-5-9-17-36-14.jpg','2023-05-09 17:36:14',16),('dunsanjjang32','안녕하세요 강아지 하네스 무료나눔합니다','자세한 문의는 댕톡주세요\n이건데 저희 강아지한테는 조금 크네요\n무료나눔하고싶습니다','dunsanjjang32-2023-5-9-17-43-26.jpg','2023-05-09 17:43:26',17),('mung305','강아지 음식 나눔합니다^^','우리 보리가 좋아하는 간식이에요!\n이벤트 당첨돼서 조금 나눔하려고 합니다 ㅎㅎ\n댕톡 주세요!','mung305-2023-5-11-15-30-34.jpeg','2023-05-11 15:30:34',18),('mung305','선글라스 판매합니다','저 여름 휴가때 애들이랑 놀러가면서 샀던 선글라스입니다.\n지금은 애들이 착용하려고 안해서 판매합니다~\n\n가격은 1개 3000원\n2개 모두 구매하시면 5000원에 드려요. 댕톡 주세요 ㅎㅎ','mung305-2023-5-11-15-33-20.webp','2023-05-11 15:33:20',19),('test333','물건 판매합니다~','강아지 턱받이 판매해요!\n가격은 5천원입니다\n','test333-2023-5-11-16-33-43.jpg','2023-05-11 16:33:43',20),('mung305','물건팝니다','1000원','mung305-2023-5-12-16-0-53.jpg','2023-05-12 16:00:54',21);
